import React from 'react'
import style from 'styled-components';

const NominateTitle = style.h1`

  color: white;
  font-weight: bold;
  text-align: left;
  font-size: 48px;
  margin-bottom: 73px;

`;

const Form = style.input`

    width: 743px;
    height: 31px;
    color: white;
    font-size: 18px;
    font-weight: 400;
    background-color: transparent;
    border-style: solid;
    border-top: 0;
    border-left: 0;
    border-right: 0;
    border-bottom: 5px solid white;

    &::placeholder {
        font-size: 18px;
        color: #E3E3E3;
        font-weight: 400;
    }

`;

const Wrapper = style.div`

  margin: 0 22% 0 22%;
  width: 100vw;
  height: 100vh;

`;

const SearchWrapper = style.div`


`;

export default function Nominate() {
    return (
        <Wrapper>
            <NominateTitle>
                Start Nominating
            </NominateTitle>
            <Form placeholder="Type in the film title (or not up to you)"/>
            <SearchWrapper>

            </SearchWrapper>
        </Wrapper>
    );
}
